    sql: "\n      SELECT FLOOR((7 + DAYOFYEAR(`Staples`.`Ship Date`) - 1 + DAYOFWEEK(DATE_FORMAT(`Staples`.`Ship\
      \ Date`, '%Y-01-01 00:00:00')) - 1) / 7) AS `DATEPART('week',Ship Date)`,\n  ADDDATE(FROM_DAYS(\
      \ TO_DAYS(`Staples`.`Ship Date`) - (DAYOFWEEK(`Staples`.`Ship Date`) - 1) ), INTERVAL\
      \ 0 SECOND ) AS `DATETRUNC('week',Ship Date)`,\n  `Staples`.`Ship Date` AS `Ship\
      \ Date`,\n  DAYOFWEEK(`Staples`.`Ship Date`) AS `wd_Ship Date_ok`\nFROM `Staples`\n\
      WHERE (`Staples`.`Ship Date` <= TIMESTAMP('1997-02-01 00:00:00'))\nGROUP BY 1,\n\
